function fetchAndDisplayXMLData(e,t){fetch(e).then(e=>e.text()).then(e=>{const o=new DOMParser,n=o.parseFromString(e,"text/xml"),i=n.querySelector("Description").textContent,a=n.querySelector("Footnote").textContent,r=Array.from(n.querySelectorAll("ArrayOfCell")).map(e=>{const t=Array.from(e.querySelectorAll("Cell"));return t.map(e=>e.querySelector("Value").textContent)}),c=n.querySelector("Title").textContent;let s=`
                       <div class="bio">
                        <h2>${c}</h2>
                        <p>${i}</p>
                        <p> ${a}</p> <!-- Display Footnote -->
                        </div>
                        <table>
                            <tr>
                                <th>Level</th>
                                <th>Rate</th>
                            </tr>
                    `;r.forEach(e=>{const t=e[0],n=e[1];s+=`
                            <tr>
                                <td>${t}</td>
                                <td>${n}</td>
                            </tr>
                        `}),s+=`</table>`,document.getElementById(t).innerHTML=s}).catch(e=>{console.error("Error fetching XML data:",e)})}